import React from "react";

export const About = () => {
    return (
        <div className="container my-5">
            This is a Todo app, where you can put title and description of your daily todo task and it will be added in your todo list.
            you can delete it when the task is done. it is a react js based app. hope you like it.
        </div>
    )
}
